import React, { useEffect, useState } from 'react'
import { StoreBaseUrl } from '../../constants'
import ShopOwnerDashboard from './ShopOwnerDashboard/ShopOwnerDashboard'
import MenuitDashboard from './MenuitDashboard/MenuitDashboard'

function Dashboard() {
    const [user, setUser] = useState({})
    useEffect(()=>{
        const token = localStorage.getItem('token')
        if(token != null){
            // console.log(token)
            axios.get(StoreBaseUrl + 'user/profile',{
                'headers':
                {
                'Authorization':`Token ${token}`
            }
            }).then((res)=>{
                console.log(res.data)
                // if(res.data.type == 'shopowner'){
                    setUser(res.data)
                // }
                // else if(res.data.type == 'menuitadmin'){
                //     setUserType('menuitadmin')
                // }
            }).catch((e)=>{
                console.log(e)
            })
        }
    },[])

    useEffect
    
  return (
    <div>
    username  - {user.username}
     {user.type == 'shopowner'?<ShopOwnerDashboard/>:user.type == 'menuitadmin'?<MenuitDashboard/>:"something went wrong"}
    </div>
  )
}

export default Dashboard
